import { React } from "react";

const LoginInputBox = ({ title, input }) => {
  return (
    <div className="LoginInputBox">
      <div>
        <h3 className="login_input_title">{title}</h3>
        <div className="login_input_box">{input}</div>
      </div>
    </div>
  );
};

export default LoginInputBox;
